INSERT INTO book (author, title, description, isbn, price, create_at, update_at) VALUES ('김영한', '자바 ORM 표준 JPA 프로그래밍', '자바 ORM 표준 JPA는 SQL 작성 없이 객체를 데이터베이스에 직접 저장할 수 있게 도와주고, 객체와 관계형 데이터베이스의 차이도 중간에서 해결해준다. 이 책은 JPA 기초 이론과 핵심 원리, 그리고 실무에 필요한 성능 최적화 방법까지 JPA에 대한 모든 것을 다룬다. 또한, 스프링 프레임워크와 JPA를 함께 사용하는 방법을 설명하고, 스프링 데이터 JPA, QueryDSL 같은 혁신적인 오픈 소스를 활용해서 자바 웹 애플리케이션을 효과적으로 개발하는 방법을 다룬다.', '9788960777330', 43000, NOW(), NOW());
INSERT INTO book (author, title, description, isbn, price, create_at, update_at) VALUES ('이동욱', '스프링 부트와 AWS로 혼자 구현하는 웹 서비스', '이 책은 제목 그대로 스프링 부트와 AWS로 웹 서비스를 구현합니다. JPA와 JUnit 테스트, 그레이들, 머스테치, 스프링 시큐리티를 활용한 소셜 로그인 등으로 애플리케이션을 개발하고, 뒤이어 AWS 인프라의 기본 사용법과 AWS EC2와 RDS를 사용해 서비스가 가능하도록 합니다. 이렇게 점진적으로 스프링 부트 프로젝트를 개선해서 배포 자동화하고 무중단 배포까지 경험합니다. 실무 현장에서의 노하우와 테스트 방법, 객체지향 프로그래밍 등을 소개하고 다룹니다. 스프링으로 하는 웹 개발이 이제는 어렵고 복잡하지 않습니다. 이 책은 기초 자바 지식만 있다면 편하게 진행할 수 있습니다. 스프링 부트 개념 설명에 집중하기 보단, 만드는 재미와 책을 보고 무엇을 만들 수 있을까에 집중했습니다. 국내 많은 서비스 회사들은 자바와 스프링을 사용하고 있습니다. 원하는 회사의 기술 스택과도 일치하고 구현하고 싶은 서비스도 쉽고 빠르게 만들고자 합니다. 전공 과제나 졸작, 취업 포트폴리오를 만들고 싶은 분들이나 실제 서비스 경험이 없는 주니어 개발자분들에게 도움이 될 것입니다.', '9788965402602', 22000, NOW(), NOW());
INSERT INTO book (author, title, description, isbn, price, create_at, update_at) VALUES ('최범균', '주니어 백엔드 개발자가 반드시 알아야 할 실무 지식', '서비스 환경에서는 커넥션을 닫지 않아 서버가 멈추고 외부 API의 지연이 전체 장애로 번지며 사소한 설정 실수가 사용자 전체에 영향을 주는 일이 실제로 발생한다. 이 책은 주니어 백엔드 개발자가 실제 현장에서 자주 마주치는 문제들을 스스로 이해하고 해결할 수 있도록 돕는 실무 밀착 가이드다. 겉보기엔 잘 돌아가는 서비스라도 규모가 커지고 사용자가 늘어나면 언제든 위기 상황에 직면할 수 있다. 이 책은 성능 저하, DB 연결 오류, 비동기 연동 문제, 동시성 제어, 인프라 운영, 보안 취약점 등 서비스 운영 과정에서 겪게 되는 핵심 이슈를 살펴보면서 왜 이런 문제가 발생하는지, 어떻게 대응해야 하는지를 체계적으로 알려준다. 이 책으로 실무에서의 혼란과 시행착오를 줄이고 서비스 운영 과정에서 발생할 여러 문제를 예방하거나 해결하는 역량을 키울 수 있을 것이다.', '9791169213745', 28000, NOW(), NOW());
